Een oorlogsveteraan (Dolph Lundgren) wordt op een nacht aangevallen in zijn huis door ninjas. Hij komt samen met hen in een vortex terecht die hem terug in de tijd stuurt. Ze belanden in de Middeleeuwen. Hij komt er achter dat hij de zoon van Farmer is en naar de \'toekomst\' is gestuurd, waar hij opgegroeid blijkt te zijn een weeshuis. Het Koninkrijk Ehb blijkt vernietigd en iedereen is inmiddels dood. Hij is de enige overlevende van het Koninkrijk Ehb en zou het weer opnieuw aan de macht kunnen krijgen.


